        {
            var encodedStr = variableName.Substring(3);
            concatenatedStr += encodedStr;
        }

        int i, idx = 0;
        for (i = 0; i < length; i++)
        {
            string encodedVal = concatenatedStr.Substring(idx, 2);
            int decoded = Array.IndexOf(encodingArray, encodedVal[0]) * 63 + Array.IndexOf(encodingArray, encodedVal[1]) - 128;
            double dequantized = (decoded - zeropoint) /  scale;
            assignValue(i, dequantized);
            idx += 2;
        }
    }

    public static double[][] LoadParams(string[] variableNames, int rows, int columns, int zeropoint, double scale)
    {
        double[][] result = new double[rows][];
        for (int i = 0; i < rows; i++)
            result[i] = new double[columns];
        LoadParamsHelper(variableNames, rows * columns, zeropoint, scale, (idx, value) => result[idx / columns][idx % columns] = value);
        return result;
    }

    public static double[] LoadParams(string[] variableNames, int length, int zeropoint, double scale)
    {
        double[] result = new double[length];
        LoadParamsHelper(variableNames, length, zeropoint, scale, (idx, value) => result[idx] = value);
        return result;
    }


}

public class NeuralNetwork
{
    private double[][][] fc_weights;
    private double[][] fc_biases, embedding;

    public NeuralNetwork(double[][][] fc_weights, double[][] fc_biases, double[][] embedding)
    {
        this.fc_weights = fc_weights;
        this.fc_biases = fc_biases;
        this.embedding = embedding;
    }
    public double[] FeedForward(double[] input)
    {
        int i, j, k;
        for (i = 0; i < fc_weights.Length; i++)
        {
            double[] layerOutput = new double[fc_weights[i].Length];
            for (j = 0; j < fc_weights[i].Length; j++)
            {
                double sum = 0;
                for (k = 0; k < fc_weights[i][j].Length; k++)
                    sum += input[k] * fc_weights[i][j][k];
                // no relu on the last layer
                layerOutput[j] = i != fc_weights.Length - 1 ? Math.Max(0, (sum + fc_biases[i][j])) : sum;
            }
            input = layerOutput;
        }
        return input;
    }
    public double forward(Board board)
    {
        double[] boardStateCopy, e;
        boardStateCopy = new double[261];
        for (int i = 0; i < 64; i++)
        {
            Piece piece = board.GetPiece(new Square(i));
            e = embedding[(piece == null) ? 0 : piece.IsWhite ? (int)piece.PieceType : (int)piece.PieceType + 6];
            // embedding size is 4
            for (int j = 0; j < 4; j++)
                boardStateCopy[j * 64 + i] = e[j];
        }

        // 64 * 4;
        boardStateCopy[256] = board.IsWhiteToMove ? 1.0 : 0.0;
        boardStateCopy[257] = board.HasKingsideCastleRight(true) ? 1.0 : 0.0;
        boardStateCopy[258] = board.HasQueensideCastleRight(true) ? 1.0 : 0.0;
        boardStateCopy[259] = board.HasKingsideCastleRight(false) ? 1.0 : 0.0;
        boardStateCopy[260] = board.HasQueensideCastleRight(false) ? 1.0 : 0.0;

        int turn = (board.IsWhiteToMove ? -1 : 1);
        return FeedForward(boardStateCopy)[0] * turn;
    }
}

public class MonteCarloTreeSearchNode
{
    public Board State { get; private set; }
    public MonteCarloTreeSearchNode Parent { get; private set; }
    public Move ParentAction { get; private set; }
    public List<MonteCarloTreeSearchNode> Children { get; private set; } = new List<MonteCarloTreeSearchNode>();
    private int numberOfVisits = 0;
    private double wins = 0;
    private List<Move> untriedActions;

    private double totalValue = 0;  // Total value of this node
    private NeuralNetwork nn;

    public MonteCarloTreeSearchNode(Board state, NeuralNetwork nn,  Move parentAction, MonteCarloTreeSearchNode parent = null)
    {
        this.State = state;
        this.Parent = parent;
        this.ParentAction = parentAction;
        this.untriedActions = new List<Move>(state.GetLegalMoves());
        this.nn = nn;
    }

    public double Q()
    {
        return totalValue / numberOfVisits;
    }

    public int N()
    {
        return numberOfVisits;
    }

    public MonteCarloTreeSearchNode Expand()
    {
        Move action = untriedActions[untriedActions.Count - 1];
        untriedActions.RemoveAt(untriedActions.Count - 1);
        State.MakeMove(action);
        MonteCarloTreeSearchNode child = new MonteCarloTreeSearchNode(State, this.nn,  action, this);
        Children.Add(child);
        State.UndoMove(action);
        return child;
    }

    public bool IsTerminalNode()
    {
        return State.IsInCheckmate() || State.IsDraw();
    }

    public double Rollout()
        {
            return nn.forward(State); // Assuming the network's output is the value of the state
        }

    private void UndoMovesToOriginalState()
    {
        MonteCarloTreeSearchNode currentNode = this;
        Stack<Move> moves = new Stack<Move>();
        while (currentNode.ParentAction != null)
        {
            moves.Push(currentNode.ParentAction);
            currentNode = currentNode.Parent;
        }
        while (moves.Count > 0)
        {
            State.UndoMove(moves.Pop());
        }
    }

    public void Backpropagate(double result)
    {
       numberOfVisits++;
        totalValue += result;
        if (Parent != null)
        {
            Parent.Backpropagate(result);
        }
    }

    public bool IsFullyExpanded()
    {
        return untriedActions.Count == 0;
    }

    public MonteCarloTreeSearchNode BestChild(double cParam = 1.0)
    {
        return Children.OrderByDescending(c => (c.Q() / c.N()) + cParam * Math.Sqrt(2 * Math.Log(this.N()) / c.N())).First();
    }

    public Move BestAction(int simulations)
    {
        for (int i = 0; i < simulations; i++)
        {
            MonteCarloTreeSearchNode v = TreePolicy();
            double reward = v.Rollout();
            v.Backpropagate(reward);
        }
        return BestChild(0).ParentAction;  // Return the move that leads to the best child
    }

    private MonteCarloTreeSearchNode TreePolicy()
    {
        MonteCarloTreeSearchNode currentNode = this;
        while (!currentNode.IsTerminalNode())
        {
            if (!currentNode.IsFullyExpanded())
            {
                return currentNode.Expand();
            }
            else
            {
                currentNode = currentNode.BestChild();
            }
        }
        return currentNode;
    }
}
